import React from 'react';
import '../App.css';
import './ConnectPage.css';
import { Button } from './Button';

function ConnectPage() {
  return (
    <div className='central'>
        <div
          className='login'
        >
            <a href='/LoginSection'>LOGIN</a>
        </div>
        <div
          className='signup'
        >
           <a href='/CreateSection'>SIGNUP</a>
        </div>
    </div>
  );
}

export default ConnectPage;
